
import requests
import hashlib

url='http://121.31.66.157:8032//mobile/common/login.xhtml'
username=input()
m= hashlib.md5(username.encode()).hexdigest()
data_login={
    'account':username,
    'apassword':m,
    'atype':'2'
}
res=requests.post(url,data_login)
print("......开始登录.....")
# 登录获取响应
print(res.text)
# 拿出响应信息
info_luid=eval(res.text)['luid']
info_ltoken=eval(res.text)['ltoken']
print(info_luid,info_ltoken)

# 点击实践中心，得出用户信息

url_sj='http://121.31.66.157:8032//mobile/training/s_practice.xhtml'
data_userinfo={
    'uid':info_luid,
    'token':info_ltoken
}

res_info=requests.post(url_sj,data_userinfo)
# 登录获取响应
login_info=res_info.text.encode('utf8').decode('unicode_escape')
print(login_info)
# 拿出pid
pid_info=eval(login_info)[0]['id']
print(pid_info)

# 签到
url_qd='http://121.31.66.157:8032//mobile/training/s_practice_qd.xhtml'
data_qd={
'pid':pid_info,
'uid':info_luid,
'token':info_ltoken,
'action':'qdadd',
'address':'广西壮族自治区梧州市长洲区三龙大道88号',
'jd':'111.243799',
'wd':'23.473745',
'acontent':'data:image/jpeg;'
}
pd=requests.post(url_qd,data_qd)
print(pd.text)

# 签到列表
url_qdlist='http://121.31.66.157:8032//mobile/training/s_practice_qd.xhtml'
data_list={
    'uid':info_luid,
    'pid':pid_info,
    'token':info_ltoken,
    'action':'qdlist'
}
qdlist=requests.post(url_qdlist,data_list)
print(qdlist.text.encode('utf8').decode('unicode_escape'))
